{
  "ubx_message": {
    "name": "UBX-NAV-CLOCK",
    "class_id": "0x01",
    "message_id": "0x22",
    "message_type": "periodic_polled",
    "description": "Clock solution",
    "payload_length": {
      "fixed": 20
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "name": "iTOW",
        "data_type": "U4",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See the section Navigation epochs in Integration manual for details. See the section iTOW timestamps in Integration manual for details."
      },
      {
        "byte_offset": 4,
        "name": "clkB",
        "data_type": "I4",
        "unit": "ns",
        "description": "Clock bias"
      },
      {
        "byte_offset": 8,
        "name": "clkD",
        "data_type": "I4",
        "unit": "ns/s",
        "description": "Clock drift"
      },
      {
        "byte_offset": 12,
        "name": "tAcc",
        "data_type": "U4",
        "unit": "ns",
        "description": "Time accuracy estimate"
      },
      {
        "byte_offset": 16,
        "name": "fAcc",
        "data_type": "U4",
        "unit": "ps/s",
        "description": "Frequency accuracy estimate"
      }
    ]
  }
}
